    <Row className="style" xs={1} md={2} lg={3}>
      <CompCard
        bsVariant="top"
        imgSrc="https://a.cdn-hotels.com/gdcs/production87/d1048/4ed1a1e8-afa7-4640-b8ca-d1d6ccbb54c1.jpg?impolicy=fcrop&w=1600&h=1066&q=medium"
        title=""
      />
      <CompCard />
      <CompCard />
    </Row>
  );
}

export default AdventureComp;
